nce: json["insurance"],  );  Map<String, dynamic> toJson() => {    "carImage": carImage,    "driverDiclaration": driverDiclaration,    "fh1": fh1,    "insurance": insurance,  };}class VendorInfo {  final String? vendorId;  VendorInfo({    this.vendorId,  });  factory VendorInfo.fromJson(Map<String, dynamic> json) => VendorInfo(    vendorId: json["vendor_id"],  );  Map<String, dynamic> toJson() => {    "vendor_id": vendorId,  };}